import React from "react";
import Modal from 'react-modal';

Modal.setAppElement('#root')

function InputModal(props: any) {
  const {showMod, handleMod} = props
  return (
    <div>
      <Modal isOpen={showMod} className="modal" overlayClassName="overlayModal">
        <h1 className='modal-close-btn' onClick={(e) =>handleMod(e,false)} > X </h1>
        <div className='modal-container'>
            <h3 className='modal-head'> Input expense </h3>
        </div>

      </Modal>
    </div>
  );
}

export default InputModal;
